import { Router } from "@reach/router";
import Login from "./Login";
import Register from "./Register";
import Dashboard from "./Dashboard";

function App() {
	const user = null;
	console.log(user);
	return (
		user ?
		<Dashboard />
		:
		<Router>
			<Register path="register" />
			<Login path="/" />
		</Router>

	);
}

export default App;
